flag_parts = [b'', b'', b'', b'', b'', b'', b'', b'', b'', b'', b'', b'', b'', b'', b'', b'', b'', b'', b'', b'', b'', b'', b'', b'', b'', b'', b'', b'', b'', b'', b'', b'', b'', b'', b'', b'', b'', b'', b'', b'', b'', b'', b'', b'']


start_time = datetime.datetime(2025, 9, 2, 19, 0, 0)

def random_time(i):
    return (start_time + datetime.timedelta(seconds=i*random.randint(1,5))).strftime("%d/%b/%Y:%H:%M:%S +0700")

